INSERT INTO `book_lesson` VALUES (5,51,10,'6',NULL,'yes','Hi there,\r\n\r\nI have read a lot about the Curry-Howard isomorphism, but its relevance is not yet clear to me. I know there are experts on this topic here in this board, so please enlighten me :-)\r\n\r\nTechnically, I understand the relation between simply-typed lambda calculus and constructive logic and how the isomorphism between proofs and programs works.\r\n','asap','0000-00-00 00:00:00','any','','myself','','0000-00-00 00:00:00',NULL,'0601020304','34 Rue de Dunkerque, Paris, France','2016-02-06 22:20:13','2016-02-06 21:41:18'),(6,51,10,'6',NULL,'yes','With Clojure 1.5, edn has become a standard part of the language. Edn is like an extensible JSON where the keys of objects can be any value (not just strings). It is based on the Clojure literal syntax, much in the same way that JSON is based on Javascript literal syntax. It is a nice way to serialize data. And since you already have the JAR in your project, it\'s a no brainer to use it','asap','0000-00-00 00:00:00','teacher','','myself','','0000-00-00 00:00:00','man','1232344543512','131 Victoria Street, Londres, Royaume-Uni','2016-04-02 09:19:34','2016-03-20 11:18:06'),(118,49,6,'6',NULL,NULL,'Vel blanditiis aliquid excepturi recusandae ipsa. Rerum amet corporis animi odit quis expedita. Qui voluptatum nostrum ut eos. Neque molestiae at architecto non.','this_week','0000-00-00 00:00:00','any','','myself','','0000-00-00 00:00:00','man','0623435324','131 Victoria Street, Londres, Royaume-Uni','2016-03-27 15:09:33','2016-03-27 15:09:33'),(120,49,6,'6',NULL,NULL,'Repellendus quia accusamus minus quaerat accusamus corporis. Dolorem rerum fuga in blanditiis nulla. Reprehenderit consequatur autem quam vitae.','this_week','0000-00-00 00:00:00','any','','myself','','0000-00-00 00:00:00','man','0623435324','131 Victoria Street, Londres, Royaume-Uni','2016-03-27 15:10:22','2016-03-27 15:10:22');
